import React from 'react';

const OptTable = ({ columnDefs, rowData, height }) => {
  return (
    <div style={{ height }}>
      <table>
        <thead>
          <tr>
            {columnDefs.map((column) => (
              <th key={column.field}>{column.headerName}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {rowData && (
            rowData.map((row) => (
              <tr key={row.id}>
                {columnDefs?.map((column) => (
                  <td key={`${row.id}-${column.field}`}>{row[column.field]}</td>
                ))}
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default OptTable;
